import React from "react";
import "./Table.css";

function Table() {
  useEffect(() => {
    async function getInfo() {
      const req = await axios.get(`/explore/Info/${Handle}`); // axios returns a promise
      setUserInfo(req.data);
    }
    getInfo();
  }, []);
  return (
    <div className="table">
      <h1>I am recent problems</h1>
    </div>
  );
}

export default Table;
